	public static String[] getMetromoves(int gen) {
		switch(gen) {
		case 1: return gen1;
		case 2: return gen2;
		case 3: return gen3;
		case 4: return gen4;
		case 5: return gen5;
		case 6: return gen6;
		case 7: return gen7;
		case 8: return gen8;
		case 9: return gen9;
		}
		System.out.println("Invalid gen in getMetromoves");
		return null;
	}
	
	
	public static int getIndex(String move, int gen) {
		if(gen == 2 | gen == 4) {
			System.out.println("Don't type in metrovoes in text in gen2, gen4. Use ids instead.");
			return -1;
		}
		String[] moves = getMetromoves(gen);
		
		System.out.println(move + "   gen " + gen + "   metrolength " + moves.length);
		for (int i = 0 ; i < moves.length; i++ ) {
			if(move.equals(moves[i])) {
				System.out.println("index  " +i);
				return i;
			}
		}
		System.out.println("Invalid move name. Typo?");
		return -1;
		
	}
	
	public static boolean contains(String[] array, String s) {
		for(String t : array) {
			if(t!= null && t.equals(s)) {
				return true;
			}
		}
		return false;
	}
	
